import React from 'react';
import { Layout, Menu, Avatar } from 'antd';

import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'

import { AirportPage } from '../pages/airport.page';
import { AirlinePage } from '../pages/airline.page';
import { RunawayPage } from '../pages/runaway.page';
import { FlightPage } from '../pages/flight.page';

const {
        Footer, Sider
  } = Layout;
  

export class MainLayout extends React.Component {

    render(){
        return (
            <Router>
                <Layout style={{minHeight:'780px', height:'100%', padding:'0px'}}>
                    <Sider>
                        <div style={{padding:'20px'}}>
                        <Avatar size={150}  src="data:image/png;base64," />
                        </div>
                        
                        <Menu
                            theme="dark"
                            mode="vertical"
                            defaultSelectedKeys={[String(window.location.pathname) !== "/" ? String(window.location.pathname): 'airports']}
                            style={{width: '100%'}}>
                            <Menu.Item key="airports">
                                <Link to="/airports">Aeroporto</Link>
                            </Menu.Item>
                            <Menu.Item key="/airlines">
                                <Link to="/airlines">Companhias Aéreas</Link>
                            </Menu.Item>
                            <Menu.Item key="/runaways">
                                <Link to="/runaways">Pistas</Link>
                            </Menu.Item>
                            <Menu.Item key="/flights">
                                <Link to="/flights">Vôos</Link>
                            </Menu.Item>
                        </Menu>
                    </Sider>
                    <Layout>
                
                        <Switch>
                            <Route path="/" exact={true} component={ AirportPage } />
                            <Route path="/airports"  component={ AirportPage } />
                            <Route path="/airlines" component={ AirlinePage } />
                            <Route path="/runaways"  component={ RunawayPage } />
                            <Route path="/flights"   component={ FlightPage } />
                        </Switch>
                    
                        <Footer style={{ textAlign: 'center' }}>
                                Aiport Manager ©2018 Created by Matheus
                        </Footer>
                    </Layout>
                
                </Layout>
            </Router>
        );
    }
}